import React from "react";
import { Segment, Transition } from "semantic-ui-react";

const Place_Definer = ({ Card_Inform, visible, OnClosed, OnSumbit }) => {
  return (
    <Transition visible={visible} animation="fade up" duration={1200}>
      <div
        style={{
          position: "absolute",
          // left: "50%",
          bottom: "0%",
          width: "100%"
        }}
      >
        <div className="ui segment">
          <form className="ui form">
            <div className="two fields">
              <div class="field">
                <label>Shop Name</label>
                <input type="text" name="Shop Name" />
              </div>
              <div class="field">
                <select class="ui fluid dropdown">
                  <option value="Restaurant">Restaurant</option>
                  <option value="Shopping all">Alabama</option>
                  <option value="Agency">Alaska</option>
                  <option value="Estate concerns">estate concerns</option>
                </select>
              </div>
            </div>
          </form>
        </div>
      </div>
    </Transition>
  );
};

export default Place_Definer;
